The plugin have to store a reference to the plugin context. Therefore, you have to implement the method set_context which is called during initialization: impl Plugin for ComparisonPluginImpl { fn set_context(&self, context: Arc<dyn PluginContext>) -> Result<(), PluginError> { self.context.0.write().unwrap().replace(context); Ok(()) }
} If you want to make use of the EntityInstanceManager you have to: Get a RwLock on the context Get a reference of the EntityInstanceManager using get_entity_instance_manager Create the entity instance using a builder (non-reactive) Create/register the entity instance using create returns a reactive entity instance impl TestManager { fn create_entity(&self) { let reader = self.context.0.read().unwrap(); let entity_instance_manager = reader.as_ref().unwrap().get_entity_instance_manager().clone(); let entity_instance = EntityInstanceBuilder::new("entity_type_name") .property("property_name", json!("property_value")) .get(); let reactive_entity_instance = entity_instance_manager.create(entity_instance); }
}

