If your plugin provide components you have to return a reference of the ComponentProvider: impl Plugin for ComparisonPluginImpl { fn get_component_provider(&self) -> Result<Arc<dyn ComponentProvider>, PluginError> { let component_provider = self.component_provider.clone(); let component_provider: Result<Arc<dyn ComponentProvider>, _> = <dyn query_interface::Object>::query_arc(component_provider); if component_provider.is_err() { return Err(PluginError::NoComponentProvider); } Ok(component_provider.unwrap()) }
} If your plugin doesn't provide components: impl Plugin for ComparisonPluginImpl { fn get_component_provider(&self) -> Result<Arc<dyn ComponentProvider>, PluginError> { Err(PluginError::NoComponentProvider) }
} The same applies to all other providers: ComponentProvider EntityTypeProvider RelationTypeProvider EntityBehaviourProvider RelationBehaviourProvider FlowProvider WebResourceProvider
